import React from "react";
import styled from "styled-components";

const Wrapper = styled.main`
  width: 100%;
  height: 100%;
  background-color: "#f7f8fa";
  padding-top: 64px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  box-sizing: border-box;
`;
function Posdown() {
  return (
    <Wrapper>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="43.514"
        height="52.217"
        viewBox="0 0 43.514 52.217"
        className="down"
      >
        <path
          d="M50.264 22.926H37.836V4.5H19.179v18.426H6.75l21.757 21.5zM6.75 50.571v6.146h43.514v-6.146z"
          transform="translate(-6.75 -4.5)"
          style={{ fill: "#007fff" }}
        />
      </svg>
      <div className="title">뭉치 POS 다운로드</div>
      <div className="sub">
        뭉치는 소상공인과 함께 성장하고자 모든 개발 프로그램을
        <span> 무료로 배포</span>합니다. <br /> 간단한 이메일 인증과 함께 든든한
        판매 파트너 뭉치를 만나보세요!
      </div>
      <div className="box">
        <div className="title"></div>
        <div className="sub"></div>
      </div>
    </Wrapper>
  );
}

export default Posdown;
